void fast_eigenvector_solver_calib_sfrd(double * eigv, int neig, Eigen::Matrix<double,4,4> &AM,
                                        Eigen::Matrix<std::complex<double>,2,4> &sols) {
    static const int ind[] = { 1,2,3 };

    Eigen::Matrix<double, 3, 4> AMs;
    double zi[2];

    for (int i = 0; i < 3; i++)	{
        AMs.row(i) = AM.row(ind[i]);
    }
    for (int i = 0; i < neig; i++) {
        zi[0] = eigv[i];
        for (int j = 1; j < 2; j++) {
            zi[j] = zi[j - 1] * eigv[i];
        }
        Eigen::Matrix<double, 3,3> AA;
        AA.col(0) = AMs.col(3);
        AA.col(1) = AMs.col(2);
        AA.col(2) = AMs.col(0) + zi[0] * AMs.col(1);
        AA(2,0) = AA(2,0) - zi[0];
        AA(1,1) = AA(1,1) - zi[0];
        AA(0,2) = AA(0,2) - zi[1];

        Eigen::Matrix<double, 2, 1> s = AA.leftCols(2).colPivHouseholderQr().solve(-AA.col(2));
        sols(0,i) = zi[0];
        sols(1,i) = s(1);
    }
}


void calib_known_motion_shared_frd_2p(const std::vector<Point2D> &x1, const std::vector<Point2D> &x2,
                                      const Eigen::Matrix3d &E, const CameraPose &pose, ImagePairVector *models) {
//    const double* d = data.data();
    Eigen::Matrix<double, 17, 1> data;

    data << E(0,0), E(1, 0), E(2, 0), E(0, 1), E(1, 1), E(2, 1), E(0, 2), E(1, 2), E(2, 2),
            x1[0](0), x1[0](1), x2[0](0), x2[0](1), x1[1](0), x1[1](1), x2[1](0), x2[1](1);

    const double* d = data.data();
    Eigen::VectorXd coeffs(11);
    coeffs[0] = d[8]*std::pow(d[9],2)*std::pow(d[11],2) + d[8]*std::pow(d[10],2)*std::pow(d[11],2) + d[8]*std::pow(d[9],2)*std::pow(d[12],2) + d[8]*std::pow(d[10],2)*std::pow(d[12],2);
    coeffs[1] = d[8]*std::pow(d[9],2) + d[8]*std::pow(d[10],2) + d[8]*std::pow(d[11],2) + d[8]*std::pow(d[12],2);
    coeffs[2] = d[8];
    coeffs[3] = d[6]*std::pow(d[9],2)*d[11] + d[6]*std::pow(d[10],2)*d[11] + d[2]*d[9]*std::pow(d[11],2) + d[5]*d[10]*std::pow(d[11],2) + d[7]*std::pow(d[9],2)*d[12] + d[7]*std::pow(d[10],2)*d[12] + d[2]*d[9]*std::pow(d[12],2) + d[5]*d[10]*std::pow(d[12],2);
    coeffs[4] = d[2]*d[9] + d[5]*d[10] + d[6]*d[11] + d[7]*d[12];
    coeffs[5] = d[0]*d[9]*d[11] + d[3]*d[10]*d[11] + d[1]*d[9]*d[12] + d[4]*d[10]*d[12];
    coeffs[6] = d[8]*std::pow(d[13],2)*std::pow(d[15],2) + d[8]*std::pow(d[14],2)*std::pow(d[15],2) + d[8]*std::pow(d[13],2)*std::pow(d[16],2) + d[8]*std::pow(d[14],2)*std::pow(d[16],2);
    coeffs[7] = d[8]*std::pow(d[13],2) + d[8]*std::pow(d[14],2) + d[8]*std::pow(d[15],2) + d[8]*std::pow(d[16],2);
    coeffs[8] = d[6]*std::pow(d[13],2)*d[15] + d[6]*std::pow(d[14],2)*d[15] + d[2]*d[13]*std::pow(d[15],2) + d[5]*d[14]*std::pow(d[15],2) + d[7]*std::pow(d[13],2)*d[16] + d[7]*std::pow(d[14],2)*d[16] + d[2]*d[13]*std::pow(d[16],2) + d[5]*d[14]*std::pow(d[16],2);
    coeffs[9] = d[2]*d[13] + d[5]*d[14] + d[6]*d[15] + d[7]*d[16];
    coeffs[10] = d[0]*d[13]*d[15] + d[3]*d[14]*d[15] + d[1]*d[13]*d[16] + d[4]*d[14]*d[16];

    // Setup elimination template
    static const int coeffs0_ind[] = { 0,6,1,0,6,7,2,1,0,6,7,2,3,0,6,8,2,1,0,6,7,2,4,3,1,0,7,6,8,9,2,1,7,2,4,3,2,1,6,2,8,0,7,9,5,3,8,10,2,2,4,3,2,8,7,9,1,2,4,9,2,2,5,4,8,10,3,9,5,4,3,9,8,10 };
    static const int coeffs1_ind[] = { 10,5,5,10,9,4,5,10,5,10 };
    static const int C0_ind[] = { 0,13,14,15,26,27,28,29,30,37,40,41,42,45,50,55,57,58,60,62,65,68,70,71,73,75,78,81,82,83,86,88,90,93,99,100,101,103,105,106,107,108,109,110,112,115,120,125,130,132,142,144,145,146,147,149,150,151,158,160,161,164,170,173,175,177,178,179,183,185,187,190,193,194 } ;
    static const int C1_ind[] = { 7,10,18,20,21,24,33,39,45,50 };

    Eigen::Matrix<double,14,14> C0; C0.setZero();
    Eigen::Matrix<double,14,4> C1; C1.setZero();
    for (int i = 0; i < 74; i++) { C0(C0_ind[i]) = coeffs(coeffs0_ind[i]); }
    for (int i = 0; i < 10; i++) { C1(C1_ind[i]) = coeffs(coeffs1_ind[i]); }

    Eigen::Matrix<double,14,4> C12 = C0.partialPivLu().solve(C1);

    // Setup action matrix
    Eigen::Matrix<double,7, 4> RR;
    RR << -C12.bottomRows(3), Eigen::Matrix<double,4,4>::Identity(4, 4);

    static const int AM_ind[] = { 4,0,1,2 };
    Eigen::Matrix<double, 4, 4> AM;
    for (int i = 0; i < 4; i++) {
        AM.row(i) = RR.row(AM_ind[i]);
    }

    Eigen::Matrix<std::complex<double>, 2, 4> sols;
    sols.setZero();

    // Solve eigenvalue problem
    double p[1+4];
    Eigen::Matrix<double, 4, 4> AMp = AM;
    sturm::charpoly_danilevsky_piv(AMp, p);
    double roots[4];
//    int nroots;
//    nroots = univariate::solve_quartic_real(p[3]/p[4], p[2]/p[4], p[1]/p[4], p[0]/p[4], roots);
//    nroots = sturm::bisect_sturm<4>(p, roots, 1e-12);
    Eigen::EigenSolver<Eigen::MatrixXd> es(AM, false);
    Eigen::ArrayXcd D = es.eigenvalues();

    int nroots = 0;
    for (int i = 0; i < 4; i++) {
        if (std::abs(D(i).imag()) < 1e-6)
            roots[nroots++] = D(i).real();
    }

    fast_eigenvector_solver_calib_sfrd(roots, nroots, AM, sols);

    models->reserve(nroots);
    for (int i = 0; i < nroots; ++i){
        if (std::abs(sols(0, i).imag()) > 1e-8 or std::abs(sols(1, i).imag()) > 1e-8)
            continue;
        double f = sols(0, i).real();
        if (f < 0.0)
            continue;
        double k = sols(1, i).real();

        Camera camera = Camera("SIMPLE_DIVISION", {f, 0.0, 0.0, k * f * f}, -1, -1);
        models->emplace_back(pose, camera, camera);
    }
}

